import React, {
    Component,
    Children
} from 'react';
import {
    array
} from 'prop-types';
import {
    forEachChild
} from 'typescript';
import {
    bugs,
    website,
    server
} from "variables/general.js";

class FetchConnectApi extends Component {
    constructor(props) {
        super(props)
        this.state = {
            Listing: []
        }
    }

   
    componentDidMount() {
        fetch('https://www.reddit.com/r/nonbinary.json')
            .then(Listing => {
                if (!Listing.ok) {
                    throw Error("Network request failed")
                }
                return Listing;
            })
            .then(data => data.json())
            .then(data =>
                this.setState({
                    Listing: data.children
                }))
    }

    f_test() {
    }
    render() {

        this.f_test();
        if (this.state.requestFailed) return <p > Failed! < /p>
        if (!this.state.results) return <div > {this.state.Listing} < /div>
    }
}
export default FetchConnectApi;
